function addition(a,b){

    let sum = a+b;
    return sum;
}

function subtraction(a,b){

    let sub = a-b;
    return sub;
}
function multiplication(a,b){

    let mul = a*b;
    return mul;
}
function division(a,b){

    let div = a/b;
    return div;
}

export default addition;

export {subtraction,multiplication,division};
